  g_eps_sq_acc = _default_g_eps_sq_acc;
  g_eps_sq_force1 = _default_g_eps_sq_force1;
  g_eps_sq_acc1 = _default_g_eps_sq_acc1;
  g_eps_sq_force2 = _default_g_eps_sq_force2;
  g_eps_sq_acc2 = _default_g_eps_sq_acc2;
